import Cards from "./Card";
import data from "./Sdata";
function App() {
    return (
      <>
            <h1 className="heading_style"> Top 5  series of Netflex</h1>
            <cards
                imagsrc={data[0].imagsrc}
                title={data[0].imagsrc}
                sname={data[0].imagsrc}
                link={data[0].imagsrc}
            />
      </>
    );
}
export default App;
